Removed Icons
With Release v3.0.0 the Material Design Icons were updated and moved to a new codepoint range (reasons for that are in the release notes).
They are still shown here for reference, but are missing in the actual fonts.
To find for example the replacement for nf-mdi-altimeter enter just altimeter in the search box.
Some icons have been dropped without replacement.


